measurements.description:
Two hundred seventy flowers and 63 buds on 21 evenly presented upright up to 23-cm inflorescences;
45-cm wide by 30-cm high plant grown in bark and perlite mix in a 7-cm square plastic pot;

sepals and petals ovate, cream heavily overlaid dark burgundy, spotted darker burgundy;


lip saccate, yellow, blotched red;


column white, anther cap light yellow;
substance medium; texture diamond dust; also received an HCC, award #20255282.
